import React from "react";
import { Jumbotron, Container } from "react-bootstrap";
import Footer from "./Footer";

class Proyectos extends React.Component {
  render() {
    return (
      <React.Fragment>
        <Jumbotron fluid>
          <Container className="p-4">
            <h1>Proyectos</h1>
            <p>
            "Para eso se necesita locura; locura, ¿oyes? ¡El todo por el todo!”, Zorba el griego, Nikos Kazant.zakis
            </p>
          </Container>
        </Jumbotron>
        <Footer /> 
      </React.Fragment>
     
    );
  }
}

export default Proyectos;
